function FoodList({searchString,handleChange,handleSubmit}) {
    return (
			<div>
				<form onSubmit={handleSubmit}>
					<label htmlFor='search'>Search:</label>
					<input 
                    id='searchbar'
                    value={searchString}
                    id='searchString'
                    >
                    </input>
					<button type='submit'>Search</button>

				</form>
			</div>
		);
}

export default FoodList;
